import { Link } from 'react-router-dom';
import '../styles/Header.css';

function Header() {
    return (
        <header>
            <h1>Рецепты</h1>
            <nav>
                <ul>
                    <li>
                        <Link to="/">Категории</Link>
                    </li>
                    <li>
                        <Link to="/about">О нас</Link>
                    </li>
                </ul>
            </nav>
        </header>
    );
}

export default Header;
